var expect = require('expect.js');
//var server = require('../server');
var announcement = require('../../app/controller/announcement.js');



 

suite('Post&Load Announcement Test', function() {

   var Announcement = new announcement("test Announcement", 0, "test admin", 0,"yes");
  
    
    test('1.post announcement', function(done){
    Announcement.saveMessage(function(isSuccessed){
        expect(isSuccessed).to.be(true);
    });
    
      done();
    });


   
   
    test('2.load announcement', function(done) {
    
     Announcement.getMessages(function(rows) {
            length = (rows.length - 1); {
                //console.log("rows[i].src: " + length + rows[length].src);
                expect(rows[length].src).to.be("test admin");
                expect(rows[length].ismsg).to.be(0);
               // expect(rows[length].content).to.be("");
                expect(rows[length].content).to.be("test Announcement")
            }
        });

        setTimeout(function() {
            done();
        }, 1500);
    });



});